import f from "../../images/rf.jpg";
import a from "../../images/welder_in_action.jpg";
import mp from "../../images/mprosz.jpg";
import { List, SingleTile, Text, TilesNav } from "./styled";

export const Tile = () => {
  return <></>;
};

export const Tiles = () => {
  return (
    <TilesNav>
      <List>
        <SingleTile bg={a}>
          <Text>Spawanie & CNC</Text>
        </SingleTile>
        <SingleTile bg={mp}><Text>Malowanie proszkowe</Text></SingleTile>
        <SingleTile bg={f}><Text>Renowacja felg</Text></SingleTile>
              <SingleTile bg={f}><Text>Wynajem</Text></SingleTile>
      </List>
    </TilesNav>
  );
};
